import CartIcon from '../Cart/CartIcon';
import classes from '../UI/HeaderCartButton.module.css';

const HeaderCartButton = ()=>{
    return (
      <div>
        <span className={classes.icon}>
            <CartIcon></CartIcon>
        </span>
        <span>Your Cart</span>
        <span className={classes.badge}>3</span>
      </div>
    );
}

export default HeaderCartButton;
